import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click notifications button to open modal
    await page.waitForSelector('#notificationsBtn');
    await page.click('#notificationsBtn');
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notifications_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notifications_modal.png'));

    // Wait for notification time elements to load
    await page.waitForSelector('.notification-time', { timeout: 5000 });

    // Extract all notification time elements
    const timeElements = await page.$$('.notification-time');
    const timestamps = [];

    // Process each time element
    for (let i = 0; i < timeElements.length; i++) {
      const timeText = await timeElements[i].evaluate(el => el.textContent.trim());

      // Parse time text to standardized timestamp
      let timestamp;
      if (timeText.includes('minute')) {
        const minutes = parseInt(timeText.match(/\d+/)[0]);
        timestamp = new Date(Date.now() - minutes * 60000).toISOString();
      } else if (timeText.includes('hour')) {
        const hours = parseInt(timeText.match(/\d+/)[0]);
        timestamp = new Date(Date.now() - hours * 3600000).toISOString();
      } else if (timeText.includes('day')) {
        const days = parseInt(timeText.match(/\d+/)[0]);
        timestamp = new Date(Date.now() - days * 86400000).toISOString();
      } else {
        // Handle absolute dates (assuming format like "Jan 15")
        const currentYear = new Date().getFullYear();
        timestamp = new Date(`${timeText} ${currentYear}`).toISOString();
      }

      timestamps.push(timestamp);
    }

    // Take final screenshot with extracted data
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_timestamps_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_timestamps_extracted.png'));

    return {
      success: true,
      action: "Extracted notification timestamps for activity pattern analysis",
      extractedData: {
        timestamps: timestamps,
        count: timestamps.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

