import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click notifications button to open modal
    await page.waitForSelector('#notificationsBtn', { timeout: 5000 });
    await page.click('#notificationsBtn');
    await page.waitForTimeout(1000); // Wait for animation

    // Wait for notification modal to appear using multiple selector strategies
    const notificationModalSelector = '.notification-modal, [class*="notification"], [class*="modal"]';
    await page.waitForSelector(notificationModalSelector, { timeout: 5000 });

    // Take screenshot of notification modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notification_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notification_modal.png'));

    // Extract time information from notification elements
    const timeElements = await page.$$eval('.notification-time', elements => 
        elements.map(el => el.textContent.trim())
    );

    // Convert time strings to timestamps
    const timestamps = timeElements.map(timeText => {
        // Parse relative time formats (e.g., "2 hours ago", "5 minutes ago")
        const now = new Date();
        if (timeText.includes('hour')) {
            const hours = parseInt(timeText);
            return new Date(now - hours * 60 * 60 * 1000).toISOString();
        } else if (timeText.includes('minute')) {
            const minutes = parseInt(timeText);
            return new Date(now - minutes * 60 * 1000).toISOString();
        } else if (timeText.includes('day')) {
            const days = parseInt(timeText);
            return new Date(now - days * 24 * 60 * 60 * 1000).toISOString();
        }
        // Return original text if format not recognized
        return timeText;
    });

    // Take final screenshot with highlighted time elements
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_time_elements.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_time_elements.png'));

    return {
      success: true,
      action: "Extracted notification time data and converted to timestamps",
      extractedData: {
        timeElements,
        timestamps
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
